import React from 'react';

const DownLoad = (props) => {
    React.useEffect(() => {
        props.setDownload(false);
    }, [])
    return(
        <div style={{display: 'none'}}>
            <iframe src={`http://localhost:4000/file/download/${props.id}`} />
        </div>
    )
}

export default DownLoad;
